function obtenerLetraColumnaDesdeNumero(numero) {
  if (numero >= 1) {
    // 18278 es la cantidad máxima de letras de columna en Excel (26^2 + 26)
    let letra = "";
    while (numero > 0) {
      const modulo = (numero - 1) % 26;
      letra = String.fromCharCode(65 + modulo) + letra; // 65 es el código ASCII de 'A'
      numero = Math.floor((numero - 1) / 26);
    }
    return letra;
  } else {
    return "Número fuera de rango";
  }
}

async function agregarDatosExcel(nombreHoja, data) {


  try {
    await Excel.run(async (context) => {
      var sheet = context.workbook.worksheets.getActiveWorksheet();
      await context.sync();

      // Fila específica a la que quieres agregar los datos (19377 en este caso)
      const fila = await numeroFila(sheet, context);


      let columnaLetra = obtenerLetraColumnaDesdeNumero(data[0].length);

      // Ajusta esta ubicación según tus necesidades
      let dataRange = sheet.getRange(`A${fila}:${columnaLetra}${fila}`);
      dataRange.values = data;

      return context.sync();
    });
  } catch (error) {

  }
}
/**
 * Obtiene los datos de una columna específica de una hoja de Excel.
 * 
 * @param {string} nombreHoja - El nombre de la hoja de trabajo.
 * @param {string} letraColumna - La letra de la columna (ejemplo: 'A').
 * @returns {Promise<Array>} Un array con los datos de la columna.
 */
function obtenerDatosDeColumna(nombreHoja, letraColumna = 'A') {
  return Excel.run(function (context) {
    var workbook = context.workbook;
    var worksheets = workbook.worksheets;
    worksheets.load('items/name');
    return context.sync().then(function () {
      // Verifica si la hoja de trabajo existe
      if (!worksheets.items.map(sheet => sheet.name).includes(nombreHoja)) {
        throw new Error(`La hoja de trabajo '${nombreHoja}' no existe.`);
      }

      var sheet = worksheets.getItem(nombreHoja);
      var columna = sheet.getRange(`${letraColumna}:${letraColumna}`);
      columna.load('values');

      return context.sync().then(function () {
        if (!columna.values || columna.values.length === 0) {
          return []; // Devuelve un array vacío si no hay datos
        }

        var datosDeLaColumna = columna.values.map(function (fila) {
          return fila[0];
        });

        // Filtra los valores no definidos o vacíos
        return datosDeLaColumna.filter(valor => valor !== undefined && valor !== "");
      });
    });
  }).catch(function (error) {
    console.error("Error: " + error);
    if (error instanceof OfficeExtension.Error) {
      console.error("Debug info: " + JSON.stringify(error.debugInfo));
    }
    throw error; // Propaga el error
  });
}

