function extraerDatos() {
  try {
    //lista de los imputs a recojer
    const elementos = [
      `fechaSatinado`,
      `fechaProduccion`,
      `horaClorado`,
      `turno`,
      `satinador`,
      `auxiliares`,
      `lote`,
      `referencia`,
      `referenciaExtraida`,
      `reproceso`,
      `tipoReproceso`,
      `satinadorAnterior`,
      `satinadoraAnterior`,
      `registroAnterior`,
      `satinadora`,
      `registro`,
      `unidades`,
      `unidadesMaximas`,
      `hipoclorito`,
      `acidoNitrico`,
      `hiposulfito`,
      `agua`,
      `tiempoSatinado`,
      `tiempoNeutralizacion`,
      `tiempoEnjuague`,
      `pesoAntes`,
      `pesoDespues`,
      `observaciones`
    ]
    //`recojer el valor de cada uno
    const data = {};
    elementos.forEach(element => {
      const elementoActual = obtenerElemento(element);
      data[element] = elementoActual ? elementoActual.value : null;
    });

    // Devolvemos un objeto para tenerlo más adaptativo
    return data;
  } catch (error) {
    console.error('Error al recolectar la data del formulario: ', error);
  }
}

function obtenerElemento(id) {


  const elemento = document.getElementById(id);
  if (!elemento) {
    console.error(`Elemento no encontrado: ${id}`);
    return null;
  }

  return elemento;
}

