async function registro() {
  // Obtén la hoja activa
  const sheet = Excel.run(function (context) {
    return context.workbook.worksheets.getActiveWorksheet();
  });

  // Obtén la última celda de la columna P
  const lastCell = sheet.getRange("P:P").load("address");

  // Ejecuta la consulta
  return Excel.run(function (context) {
    return context.sync().then(function () {
      // Imprime la dirección de la última celda de la columna P
      console.log(lastCell.address);
      return lastCell.address
    });
  });

}
